import React, {Component} from 'react';
import { connect} from 'react-redux';
import './index.css';

import logo from './logo.svg';



class DajanHeader extends React.Component {
  constructor(){
    super();
   
    }

goToGoogleAuth = ()=>{


  window.open("http://localhost:4000/auth/google","_self");

}
    
    

  render(){
    return (
    <div >
     <header>
       
       
       <div className="logo"></div>
       <div className="titleName">NewAge Snack-Bar</div>
       {!this.props.loggedIn ? <button onClick={this.goToGoogleAuth} className="googleSignIn">Sign-in with Google</button> : <button onClick={this.goToGoogleAuth} className="googleSignIn">Sign-in with Google</button>}



       
       </header>
    </div>
  );
    }
}

const mapStateToProps = (state) =>{

  return{
     
      
    loggedIn:state.loggedIn


    
  }

}

const mapDispatchToProps = (dispatch) =>{

  return{
        
        //fetchAlcoholicDrinks: () =>{dispatch(fetchAlcoholicDrinks())}
      

  }
}



export default connect(mapStateToProps, mapDispatchToProps)(DajanHeader);
